var NIR=form.getItem('PAT_NUMERO_SS').getValue();
var result=document.getElementById('c9037b2c-2a9b-43bb-8913-b65c03346577');
var NIRdebut=NIR.slice(0,5);
var NIRdep=NIR.slice(5,7);
var NIRfin=NIR.slice(7);
var RIB=0;
if(NIRdep=='2A'||NIRdep=='2a'){NIRdep='19';}if(NIRdep=='2B'||NIRdep=='2b'){
    NIRdep='18';
}
NIR=NIRdebut+NIRdep+NIRfin;
RIB=97-(parseInt(NIR)%97);
if(NIR!=''){
    result.innerHTML=RIB;
} else {
    result.innerHTML='';
}

