    }
    
    body {
        font-family: "Calibri";
        margin: 0;
        font-weight: normal!important;
        line-height: 1.2;
        color: #292b2c;
        background-color: #fff;
        font-size:0.5rem;
    }
    
    article,
    aside,
    footer,
    header,
    nav,
    section {
        display: block
    }
    
    h1 {
        font-size: 2em;
        margin: .67em 0
    }
    
    figcaption,
    figure,
    main {
        display: block
    }
    
    figure {
        margin: 1em 40px
    }
    
