        -webkit-box-sizing: content-box;
        box-sizing: content-box;
        height: 0;
        overflow: visible
    }
    
    pre {
        font-size: 1em
    }
    
    a {
        background-color: transparent;
        text-decoration-skip: objects;
        -webkit-text-decoration-skip: objects
    }
    
    a:active,
    a:hover {
        outline-width: 0
    }
    
    abbr[title] {
        border-bottom: none;
        text-decoration: underline;
        text-decoration: underline dotted
    }
    
    b,
    strong {
        font-weight: inherit
    }
    
    b,
    strong {
        font-weight: bolder
    }
    
    code,
    kbd,
    samp {
        font-size: 1em
    }
    
    dfn {
        font-style: italic
    }
    
